import React, { useState } from "react";
import Modal from "./Modal";
import NestedModal from "./Nested";

const WindowModal = () => {
    const [isModalOpen, setIsModalOpen] = useState(false)
    const [isNestedModalOpen, setIsNestedModalOpen] = useState(false);

    const openModal = () => {
        setIsModalOpen(true);
        setIsNestedModalOpen(false)
    }
    const closeModal = () => {
        setIsModalOpen(false);
    }

    const openNestedModal = () => {
        setIsNestedModalOpen(true);
        setIsModalOpen()
    }
    const closeNestedModal = () => {
        setIsNestedModalOpen(false);
    }

    return (
        <div>
            <button onClick={openModal}>Abrir Ventana Modal</button>
            <Modal isOpen={isModalOpen} onClose={closeModal}>
                <h2>Ventana Modal</h2>
                <button onClick={openNestedModal}>Abrir Ventana Modal Anidada</button>
                <NestedModal isOpen={isNestedModalOpen} onClose={closeNestedModal}>
                    <h3>Ventana Modal Anidada</h3>
                    <p>Esta es una ventana modal anidada.</p>
                </NestedModal>
            </Modal>
        </div>
    )
}

export default WindowModal;
